import HeaderBottom from "./HeaderBottom/HeaderBottom";
import CenterHeader from "./CenterHeader/CenterHeader";
import {Route} from "react-router-dom";
import PizzaContainer from "./CenterHeader/Pizza/PizzaContainer";
import SneksContainer from "./CenterHeader/Sneks/SneksContainer";
import DrinkContainer from "./CenterHeader/Drink/DrinkContainer";
import SousContainer from "./CenterHeader/Sous/SousContainer";


const Profile = () => {
    return (
        <div>
            <HeaderBottom/>
            <CenterHeader/>
            <Route path="/profile/pizza" render={() => <PizzaContainer
            />}/>
            <Route path="/profile/sneks" render={() => <SneksContainer
            />}/>
            <Route path="/profile/drink" render={() => <DrinkContainer
            />}/>
            <Route path="/profile/sous" render={() => <SousContainer
            />}/>
        </div>
    )
}
export default Profile
